import './App.css';
import React from 'react';
import { Link } from "react-router-dom";

function App() {
  return (
    <nav
      style={{
        borderBottom: "solid 1px",
        paddingBottom: "1rem",
      }}
    >
    <Link to="/">Home</Link> |{" "}
      <Link to="/reviews">Reviews</Link> |{" "}
    </nav>
  );
}

export default App;
